    [],nt"num_tags": 13,nt"name": "secretive-marsh-bird-survey-summary-from-2014-pilot-study",nt"isopen":
    false,nt"url": null,nt"notes": "After the Standardized North American Marsh
    Bird Monitoring Protocol was adopted by the U.S. Fish and Wildlife Service, a pilot
    study was conducted at Fish Springs National WIldlife Refuge to compare surveys
    techniques targeting secretive marsh birds.  Using a site-specific protocol, three
    species were targeted: American Bittern (Botaurus lentiginosus), the Sora (Porzana
    carolina), and the Virginia Rail (Rallus limicola).  When using the Standardized
    North American Marsh Bird Monitoring Protocol, this survey techniques proved most
    beneficial in documenting all species when compared to previous targeted ROC surveys.
     Data from the 2014 field season is included in this summary report.",nt"owner_org":
